	(260, 260, '2022-08-15 15:08:36', '2022-08-15 15:08:36', 'S6pdx0yLe4s', 'Impressora 3D Barata Lista De Materiais', 'Mais um super projeto est√° come√ßando hoje, √© a nossa primeira impressora 3D do canal nesse v√≠deo mostro a voc√™s todas as pe√ßas necess√°rias para a montagem, da impressora 3D incluindo todas as pe√ßas para a montagem do frame da mesmo n√£o se gostou deixe seu like e continue seguindo canal para mais v√≠deos sobre impressora.\n\nLink da desenho: http://bit.ly/2K0GjEZ\nLink da planilha com a lista de pe√ßas: https://goo.gl/Xn8pA8', '00:00:00', 'S6pdx0yLe4s', 'video/youtube', 'https://i.ytimg.com/vi/S6pdx0yLe4s/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-07 01:20:24'),
	(261, 261, '2022-08-15 15:08:36', '2022-08-15 15:08:36', '5rlT8NTovh8', 'IMPRESSORA 3D CASEIRA. Muito simples.', 'PE√áAS PRINCIPAIS INSUBSTITU√çVEIS.\n\n12 Rolamentos Lm8uu R$63,99 (Mercado livre)\n1 Acoplamento Flex√≠vel 5mm*8mm R$ 15,90 (Mercado Livre)\n3 polias mais 2 metros de correia GT2 R$ 49,90 (Mercado Livre)\n3 Endstop R$30,00 (Mercado livre)\nkit hotend + 2 MK8 + 5 bicos 0,5 R$ 139,00 (Mercado Livre)\n1 Mesa aquecida + 1 Placa de controle 3D LCD Full graphics R$ 81,62(Banggood)\n2 Eixo retificado 8mm fresa 1M Cada R$ 48,00 (Mercado Livre)\n1 Tubo ptfe 1M R$7,99 (Mercado Livre)\n1 Fonte 12V 30A 360W R$ 46,89 (Mercado Livre)\n1 Fuso T8 + Castanha bronze R$ 72,00 (Mercado Livre)\n1 kit com raps 1.4 + arduino mega 2560 + 4 Driver A4988 + dissipadores R$ 80,41 (Banggood)\n\nAT√â AQUI TOTAL DE 636,70 o desenho da estrutura foi elaborado para o motor nema 17 por√©m os pre√ßos deles mudam de acordo com a for√ßa, eu usei os de 4,7 Kg/f\nmas n√£o √© necess√°rio tudo isso, escolhendo motores mais fracos fica ainda mais barato.\n\nO projeto original antes de todas as altera√ß√µes que fiz era menor e utilizava um motor mais simples, eu at√© consegui fazer\nfuncionar mas n√£o foi muito satisfat√≥rio, e com base no projeto desse rapaz eu criei o meu do zero.\n\nlink do projeto original: https://www.youtube.com/channel/UCANTu2DwiGg0YkQu_2aPpNA/videos\n\nA estrutura pode ser feita em madeira que sair√° bem mais barata por√©m qualquer erro em corte e furo pode fazer diferen√ßa, \npor isso eu levei em uma empresa e fiz o corte em m√°quina CNC de acr√≠lico de 3mm para as pe√ßas de mesas e de 10mm para a base.\n\nPra mim saiu R$ 150,00 todas as pe√ßas cortadas em acr√≠lico.\n\nComprei uma caixa de ferramentas opcional para ficar est√©ticamente melhor.\n\nCONFIGURA√á√ÉO DO ARDU√çNO QUE USO ATUALMENTE NA MINHA IMPRESSORA, NO MARLIN.\n\n// Mechanical endstop with COM to ground and NC to Signal uses "false" here (most common setup).\n#define X_MIN_ENDSTOP_INVERTING true // set to true to invert the logic of the endstop.\n#define Y_MIN_ENDSTOP_INVERTING true // set to true to invert the logic of the endstop.\n#define Z_MIN_ENDSTOP_INVERTING true // set to true to invert the logic of the endstop.\n#define X_MAX_ENDSTOP_INVERTING false // set to true to invert the logic of the endstop.\n#define Y_MAX_ENDSTOP_INVERTING false // set to true to invert the logic of the endstop.\n#define Z_MAX_ENDSTOP_INVERTING false // set to true to invert the logic of the endstop.\n#define Z_MIN_PROBE_ENDSTOP_INVERTING false // set to true to invert the logic of the endstop.\n\n\n// Invert the stepper direction. Change (or reverse the motor connector) if an axis goes the wrong way.\n#define INVERT_X_DIR false\n#define INVERT_Y_DIR false\n#define INVERT_Z_DIR false\n\n// @section extruder\n\n// For direct drive extruder v9 set to true, for geared extruder set to false.\n#define INVERT_E0_DIR true\n#define INVERT_E1_DIR false\n#define INVERT_E2_DIR false\n#define INVERT_E3_DIR false\n\n// default settings\n\n#define DEFAULT_AXIS_STEPS_PER_UNIT   {80, 80, 199.004, 142.85} // X, Y, Z and E\n#define DEFAULT_MAX_FEEDRATE          {300, 300, 50, 25}   // (mm/sec)\n#define DEFAULT_MAX_ACCELERATION      {3000, 3000, 100, 10000}   //  X, Y, Z, E maximum start speed for accelerated moves. E default values are good for Skeinforge 40+, for older versions raise them a lot.\n\n#define DEFAULT_ACCELERATION          3000   // X, Y, Z and E acceleration in mm/s^2 for printing moves\n#define DEFAULT_RETRACT_ACCELERATION  8000      // E acceleration in mm/s^2 for retracts\n#define DEFAULT_TRAVEL_ACCELERATION   3000    // X, Y, Z acceleration in mm/s^2 for travel (non printing) moves\n\n// The speed change that does not require acceleration (i.e. the software might assume it can be done instantaneously)\n#define DEFAULT_XYJERK                20.0    // (mm/sec)\n#define DEFAULT_ZJERK                 0.4     // (mm/sec)\n#define DEFAULT_EJERK                 5.0    // (mm/sec)', '00:00:00', '5rlT8NTovh8', 'video/youtube', 'https://i.ytimg.com/vi/5rlT8NTovh8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-07 01:22:02'),
