	(268, 268, '2022-08-15 15:08:37', '2022-08-15 15:08:37', 'cFKPWOUGScY', 'Anet A8 3D Printer Desktop / DIY Kit Review and Build', 'Top 3D Printer Overview: https://miscpro.com/top3dprinters/\n\nIn retrospect I am not impressed by Gearbest customer service a data protection.\nAffiliate link: https://www.banggood.com/custlink/GDmdachhMC\n\nSome useful links:\nhttps://pevly.com/anet-a8-upgrades/ \nhttps://www.facebook.com/groups/1068531466501015/ \n\nSubscribe: https://goo.gl/FmlHU7\nPatreon: https://www.patreon.com/EducatingSavvas\n\nInstagram:  http://instagram.com/savvas_papasavva\nMain Channel: http://www.youtube.com/SavvasPapasavva', '00:00:00', 'cFKPWOUGScY', 'video/youtube', 'https://i.ytimg.com/vi/cFKPWOUGScY/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-07 02:36:23'),
	(269, 269, '2022-08-15 15:08:37', '2022-08-15 15:08:37', 'LdET-DzsB4g', 'My Homemade 3D Printer', 'Links:\nhttps://www.thingiverse.com/thing:3091771\nhttp://www.prusamk2.com/wall-of-haribo/\nMk3 modified extruder https://www.thingiverse.com/thing:2735475\n\nSome of you may know that I was building a printer from scratch, a Prusa i3 Mk3 ish clone.\n\nOk so let me show you the details about this printer.\n\n\nMotherboard used MKS Gen V1.4:\nAmazon US (Commissions Earned): https://amzn.to/2EHmql8\nAmazon Canada (Commissions Earned): https://amzn.to/2tJEGUK\n\n\n\nVideos that might interest you:\nRetraction Calibration https://youtu.be/KwcKX3o3kCU\nExtrusion problems https://youtu.be/lvTiOxRwEtc\nCura 3 - How To Examples https://youtu.be/bJiKIPtyMgc\nHow To Dismantle The Hot End https://youtu.be/xOeSjzwnBqM\nTop 5 Features Cura 3.2 https://youtu.be/HI4tv7EsbQk\nHow to Clean a 3D Printer Nozzle https://youtu.be/hBkTeXxcFi8\nCura Time Saver Setting https://youtu.be/82VAfwyS_Cs\n\nYou can also find me on :\nFacebook: https://www.facebook.com/Franks-3D-Shop-567006427024034/\nTwitter: https://twitter.com/Franks3dshop\nInstagram: https://www.instagram.com/franks3dshop/\n\nMy Other channels:\nFrank\'s Playground https://www.youtube.com/channel/UCGWc3-CisXiKtmjRUpL1fVQ\nThe Bookaroo https://www.youtube.com/user/TheBookaroo\n\nMy gear :\nAmazon US (Commissions Earned):\nFilament used PETG MG Chemicals http://amzn.to/2gWBJdnHictop 3D Printer model 3DP-11-ATL http://amzn.to/2yF9FEY\n3D Printer Monoprice Select Mini V2 http://amzn.to/2yK9TdV\nCamera Sony A6300 http://amzn.to/2gWmaTi\nSigma Lens 30mm F1.4 http://amzn.to/2gtzeyL\nNeewer 7" Field Monitor http://amzn.to/2gWAsD7\nNeewer Accessories http://amzn.to/2xcYobL\nSanDisk Extreme 64GB SDXC UHS-I Card http://amzn.to/2yF34di\nManfrotto Compact Tripod http://amzn.to/2yEIZnv\nIMDEN Omnidirectional Condenser Lavalier Microphone http://amzn.to/2xcY4cR\nFlush cutter http://amzn.to/2nJhvrb\nDeburring tool (brim cutter) http://amzn.to/2E9yzwA\nLong Nose Pliers http://amzn.to/2BJNTT0\nTweezers http://amzn.to/2Bf5NvP\n\nAmazon Canada (Commissions Earned):\nFilament used PETG MG Chemicals http://amzn.to/2xdKo1v\n3D Printer model 3DP-11-ATL http://amzn.to/2xdgyKq\n3D Printer Monoprice Select Mini V2 http://amzn.to/2yKAUhn\nCamera Sony A6300 Kit http://amzn.to/2gVrhD4\nSigma Lens 30mm F1.4 http://amzn.to/2xWO2kJ\nNeewer 7" Field Monitor http://amzn.to/2zqL97K\nNeewer Accessories http://amzn.to/2gVrshI\nSanDisk Extreme 64GB SDXC UHS-I Card http://amzn.to/2gVrw0W\nManfrotto Compact Tripod http://amzn.to/2xVgChk\nIMDEN Omnidirectional Condenser Lavalier Microphone http://amzn.to/2xX4lOs\nFlush cutter http://amzn.to/2GVQNDr\nDeburring tool (rim cutter) http://amzn.to/2E9xy7K\nLong Nose Pliers http://amzn.to/2Bfu3hs\nTweezers http://amzn.to/2nLxpB6\n\n\nHi, I\'m Frank my channel is all about 3D printing. I can\'t get enough of my  3D printer. I make everything and anything out of 3D filament (PLA, PETG and more). As I say a printer that is not printing is a missed opportunity.\n\nI\'ll be doing electronics, mechanics, computer engineering, DIY, reviews and tutorials.\n\nI update twice a week on Tuesday and Saturdays.\n\nSubscribe to my channel, and don\'t forget to turn on notifications.', '00:00:00', 'LdET-DzsB4g', 'video/youtube', 'https://i.ytimg.com/vi/LdET-DzsB4g/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-08 11:44:12'),
