	(280, 280, '2022-08-15 15:08:37', '2022-08-15 15:08:37', 'pFOlKoyPfrU', 'Constru√ß√£o de Impressora 3D em casa, Epis√≥dio 2', 'Aten√ß√£o, esses v√≠deos demonstrativos s√£o apenas uma amostra do que eu (Patola, o cara que n√£o aparece nesse v√≠deo!) ensino nas aulas de Ensino √Ä Dist√¢ncia (EAD) da Techtraining! Fa√ßa o curso inteiro e aprenda BEM mais que isso. :-) http://www.techtraining.eng.br ou agende uma palestra se quiser conhecer nosso trabalho.\n\nDesculpe, pessoal! Tentei fazer um v√≠deo de 5 minutos mas n√£o teve jeito, a montagem do quadro √© meio longa e mesmo assim ainda n√£o terminamos, deu 12 minutos e meio com c√¢mera acelerada.\n\nD√° um pouco de trabalho mesmo montar uma graber, e olha que ela √© uma das impressoras 3D mais f√°ceis de construir. N√£o quer ter trabalho, mas gosta do jeit√£o dela? Pense se n√£o vale a pena adquirir uma impressora da Sethi3D, a AiP A3. Al√©m de muitas melhorias, refor√ßos e seguran√ßas em rela√ß√£o √† graber original, ela tem a CPU Sethi com prote√ß√£o contra descargas, LCD com cart√£o SD, garantia e suporte: http://www.sethi3d.com.br/produto/impressora-sethi3d-aip.html\n\nOu, se voc√™ ainda prefere montar para ter aprendizado e um pre√ßo (bem) mais barato, pode comprar a vers√£o em kit e com manual aqui: http://www.sethi3d.com.br/produto/kit-de-montagem-sethi3d-aip.html\n\nAh, se seu neg√≥cio √© grande volume de impress√£o? Veja se a Sethi BB n√£o atenderia a suas demandas: http://www.sethi3d.com.br/impressora-sethi3d-bb-175mm\n\nNeste epis√≥dio tratamos da primeira parte de montagem do quadro. Como existem algumas variedades diferentes de corte da graber por a√≠ (algo t√≠pico de projetos open-source), procuramos citar os que conhecemos e suas diferen√ßas, mesmo tendo que escolher um pra usar.\n\nEm especial, agradecemos ao Valter F.C., Alex Borro e Miguel d\'√Åvila por suas contribui√ß√µes. A lista de materiais completa da graber voc√™ encontra aqui: http://graberi3.blogspot.com.br/2013/11/graber-i3-lista-de-pecas-e-vitaminas.html#more\n\nNo v√≠deo usamos certos comprimentos de barras lisas que √© equivalente ao comprimento m√°ximo da lista de materiais. Fazemos isso porque vamos medir depois de montada e ent√£o cortar o excesso do tamanho certo. Se voc√™ n√£o consegue acesso a nenhuma ferramenta que corte a√ßo, pode ser prefer√≠vel encomendar o comprimento m√≠nimo.\n\nUma empresa que pode fazer esse corte de barras lisas √© a marvitubos, que atende por email e tem website. Pe√ßa barras lisas cromadas de 8 mm de di√¢metro.\n\nOs links do modelo 3D dos adaptadores de porcas M3 desse v√≠deo s√£o esses (qualquer um deles serve, imprima um para cada porca M3 que for usar):\n\nhttp://www.thingiverse.com/thing:167206\nhttp://www.thingiverse.com/thing:285311\nhttp://www.thingiverse.com/thing:341215\n\nUm dos Pillow Blocks impressos que podem ser usados com o suporte da mesa, se voc√™ n√£o quiser usar as pecinhas de MDF, √© esse: \n\nhttp://www.thingiverse.com/thing:228725\n\nOs parafusos, porcas e demais "vitaminas" (pe√ßas n√£o-impressas) que usamos neste v√≠deo s√£o:\n\n6 parafusos M3x12 ou M4x10 (o corte permite ambos, mas aconselhamos o M3x12)\n6 porcas M3 com adaptadores impressos (se voc√™ usar o M3x12) ou M4 sem adaptadores (se usar o M4x10)\n6 arruelas M4 (mesmo se usar parafuso M3x12)\n22 parafusos M3x16\n26 porcas M3 com adaptadores impressos (√© bom imprimir ou comprar pelo menos uns 50 adaptadores desses pois alguns podem quebrar durante a montagem)\n2 parafusos M3x20\n2 parafusos M3x25\n12 parafusos M3x35\n12 porcas auto-travantes M3 (porcas M3 comuns, sem adaptadores impressos, podem ser usadas, mas tender√£o mais a escapar)\n\n3 rolamentos LM8UU (rolamentos lineares com furo de 8 mm)\n\nNenhum animal foi ferido durante a confec√ß√£o desse v√≠deo (mas alguns gatinhos foram afagados) e, mais importante, nenhum SOFTWARE PROPRIET√ÅRIO foi utilizado para o mesmo. Utilizamos:\n\n- GNU/Linux como sistema operacional;\n- GIMP para edi√ß√£o de imagens de bitmap;\n- Inkscape para edi√ß√£o de imagens vetoriais;\n- Blender para os efeitos tridimensionais;\n- Audacity para edi√ß√£o de √°udio;\n- kdenlive para a edi√ß√£o do v√≠deo;\n- Mozilla Firefox (sem flash player) para upload do v√≠deo para o youtube;\n- gvim para anota√ß√µes de texto;\n- yakuake + zsh para acompanhamento da renderiza√ß√£o pelo terminal :P\n\nAs m√∫sicas, jingles e efeitos s√£o de um pacote gratuito disponibilizado num epis√≥dio especial do excelente canal "Manual do Mundo".', '00:00:00', 'pFOlKoyPfrU', 'video/youtube', 'https://i.ytimg.com/vi/pFOlKoyPfrU/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-12 11:31:30'),
