	(302, 302, '2022-10-10 14:29:52', '2022-10-10 14:29:52', 'BTUVGvbJbc8', '3D Printer | Homemade - Part 3', 'Arduino 3D Printer | Homemade - Part 3\nIn the third part of Homemade 3D Printer, I completed connecting all  3D Printer electronics to the main RAMPS 1.4 Board and Upload the Marlin code the Arduino Mega.This video also shows how to generate G-Code and send it to your 3D Printer with Slic3r and Pronterface Softwares.I printed a 20mm Test cube, which came out to be a good print.I also modified some parts of the 3D Printer, like the x-carriage, z-axis and added a cooling fan.This was the last video for this project, I Hope you enjoyed the Video!\n\nInstagram-https://www.instagram.com/shinedjar/\nFacebook-https://www.facebook.com/RZtronics/\nTwitter - https://twitter.com/RZtronix\n\nArduino Code, Software and Schematics-\nhttp://rztronics.com/arduino-3d-printer-code-software-and-schematics/\n\nParts Used:\n\nAliexpress\n\nArduino Mega+RAMPS 1.4 Shield+4 x A49AA Stepper Driver-http://s.click.aliexpress.com/e/eMvbYVn\n5 x NEMA 17 Stepper Motor-\nhttp://s.click.aliexpress.com/e/ZJAaa6Y\nE3D Hotend-\nhttp://s.click.aliexpress.com/e/bAIYJeA\n3 x Endstops-\nhttp://s.click.aliexpress.com/e/RFQfImu\nLCD Display(optional)-\nhttp://s.click.aliexpress.com/e/vJyRjyF\nHeat Bed-\nhttp://s.click.aliexpress.com/e/bmMz37I\n240 watt Power supply-\nhttp://s.click.aliexpress.com/e/fA2vBYN\nPLA Filament (1KG)-\nhttp://s.click.aliexpress.com/e/eqFu3Jm\nOR\nPLA Filament (Different Colours)-\nhttp://s.click.aliexpress.com/e/zFAMVJU\nMK8 Extruder-\nhttp://s.click.aliexpress.com/e/QBeeEAM\nGT2 Timing Belt+2 x GT2 Pulley-\nhttp://s.click.aliexpress.com/e/auneAmy\nSC8UU Bearings(Replacement for LM8UU Bearings)-\nhttp://s.click.aliexpress.com/e/VFUZjA6\n5x8mm Couplers-\nhttp://s.click.aliexpress.com/e/EAEa2bI\n8mm Smooth Rods-\nhttp://s.click.aliexpress.com/e/YNj6Eqf\nSmooth Rod Holder-\nhttp://s.click.aliexpress.com/e/MZbmqFm\nstepper Motor Mount-\nhttp://s.click.aliexpress.com/e/zZbiYZ7\n