	(303, 303, '2022-10-10 14:29:52', '2022-10-10 14:29:52', 'LIS7aB0-xfc', 'DIY 3D Printer | homemade 3D Printer', '$2/5pcs 2Layer & $5/5pcs 4Layer PCBs:  https://jlcpcb.com\n\nHello friends in this video I have made 3D printer using arduino maga, ramps1.4 board.\nprint volume of this printer is 180x180x200mm\n\n20x20 alu profile - https://amzn.to/2MTlkGw\n20x40 alu profile - https://amzn.to/2MR9Z9V\n3D printer electronic kit - https://amzn.to/3dRO4Lv\nE3D V6 hotend - https://www.banggood.in/Geekcreit-0_4mm-V6-1_75mm-LongShort-Distance-Metal-Extruder-Nozzle-With-Cooling-Fan-Set-for-3D-Printer-p-1036420.html?rmmds=search\nwheel - https://www.banggood.in/10PcsPack-TEVO-POM-Material-Big-Pulley-Wheel-with-Bearings-for-V-slot-3D-Printer-Part-p-1411601.html?rmmds=search&cur_warehouse=CN\n5 stepper motor - https://amzn.to/37n9FJa\n12v 29Amps SMPS - https://amzn.to/3cXFNV8\n\n\n#DIY3DPrinter\nüíªvisit for more projects :-\r\nüëâhttp://electricdiylab.com/\r\nüëâFB page :- https://www.facebook.com/InnovativeMr/\r\n\r\n\r\nMy Gears :- \r\nCamera :- http://amzn.to/2FO4W5E\r\n\r\nVideo Light :- http://amzn.to/2FNKzFL\r\n\r\nMic :- http://amzn.to/2HYqBZC\r\n\r\nSoldering Kit :-  http://amzn.to/2FgNd8Z\r\n\r\nScrew driver set :- http://amzn.to/2FkhHHm\r\n\r\nRotary tool :- http://amzn.to/2FM3Lnh This video is made for entertainment purposes only. Please use judgment, care, and precaution if you plan to replicate.', '00:00:00', 'LIS7aB0-xfc', 'video/youtube', 'https://i.ytimg.com/vi/LIS7aB0-xfc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-17 05:05:19'),
	(304, 304, '2022-10-10 14:29:52', '2022-10-10 14:29:52', 'VEFf1niKHEA', 'Nicer Screw Thread In SketchUp ( 3D Printable + Nut Thread ) 2020 Update notice', 'Important notice 2020!:  Helix14.rbz has disappeared from the web! But you can use : http://sketchucation.com/plugin/1379-helix_along_curve\nYou can get it when you FREE! subscribe to sketchucation.com. Draw a line along blue axis, select it and draw, helix along curve. There is no pitch, so you have calculate like 150mm (line) / 5 laps = pitch 30mm. And sections per lap 96 in this case.\n\n\n\nThis technique allows you to make flat crest and root for the thread. Also, the thread is solid, no holes. On this video closely imitating coarse M24. M24 really has a little bit different dimensions and the root is double width of the crest and usually rounded. Anyway  for some 3D printing projects not so necessary. \n\nYou need only the helix plug-in. The Solid Inspector & the CleanUp3 plug-ins make things easier when drawing more than the just the thread. I drew the outer thread "by hand" because the Boolean plugin crashed.\n\nDraw a shank with some degree angle to the end of the bolt and you get a chamfer for the nut part.\n\nThe model was 3D printed nicely on Reprap Prusa i3 FDM printer.', '00:00:00', 'VEFf1niKHEA', 'video/youtube', 'https://i.ytimg.com/vi/VEFf1niKHEA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-07-25 02:01:07'),
